import React from "react";

const Links = (props) => {
  console.log(props);
  const toLink = (link) => {
    document.location.href = link;
  };
  return (
    <div
      style={{
        width: 200,
        height: 300,
        position: "absolute",
        backgroundColor: "red",
      }}
    >
      <div onClick={() => toLink(props.record)}>
        <a>{props.record}</a>
      </div>
    </div>
  );
};

export default Links;
